title: མི་ཕམ་འཇམ་དབྱངས་རྣམ་རྒྱལ་རྒྱ་མཚོའི་རྣམ་ཐར་སྙིང་བསྡུས།
alternative-title:
- མི་ཕམ་འཇམ་དབྱངས་རྣམ་རྒྱལ་རྒྱ་མཚོའི་རྣམ་ཐར་སྙིང་པོ་བསྡུས་པ་ངོ་མཚར་བདུད་རྩིའི་རྣང་བ།
- གསང་ཆེན་ཆོས་ཀྱི་ཤིང་རྟ་འཇིགས་མེད་སྨྲ་བའི་སེངྒེ་ཀུན་མཁྱེན་བླ་མ་མི་ཕམ་འཇམ་དབྱངས་རྣམ་རྒྱལ་རྒྱ་མཚོའི་རྣམ་ཐར་སྙིང་པོ་བསྡུས་པ་ངོ་མཚར་བདུད་རྩིའི་སྣང་བ།
